import "./ExpenseItems.css";
import ExpenseItem from "./ExpenseItem";

const ExpenseItems = (props) => {
    <div></div>
  props.items.map((i) => (
    <ExpenseItem title={i.title} amount={i.amount} date={i.date} />
  ));
};

export default ExpenseItems;
